import React from "react";
import Header from "./components/header";
import Form from "./components/form";
import './App.css';

const App = () => {
  return (
    <div>
      <div>
        <div>
          <Header/>
        </div>
        <div>
          <Form/>
        </div>
      </div>
    </div>
  );
};

export default App;
